k";s:75:"a:2:{s:16:"get_license_data";i:1618490502;s:11:"get_version";i:1618490676;}";s:22:"elementor_scheme_color";s:78:"a:4:{i:1;s:7:"#6ec1e4";i:2;s:7:"#54595f";i:3;s:7:"#7a7a7a";i:4;s:7:"#61ce70";}";s:27:"elementor_scheme_typography";s:296:"a:4:{i:1;a:2:{s:11:"font_family";s:6:"Roboto";s:11:"font_weight";s:3:"600";}i:2;a:2:{s:11:"font_family";s:11:"Roboto Slab";s:11:"font_weight";s:3:"400";}i:3;a:2:{s:11:"font_family";s:6:"Roboto";s:11:"font_weight";s:3:"400";}i:4;a:2:{s:11:"font_family";s:6:"Roboto";s:11:"font_weight";s:3:"500";}}";s:29:"elementor_scheme_color-picker";s:144:"a:8:{i:1;s:7:"#6ec1e4";i:2;s:7:"#54595f";i:3;s:7:"#7a7a7a";i:4;s:7:"#61ce70";i:5;s:7:"#4054b2";i:6;s:7:"#23a455";i:7;s:4:"#000";i:8;s:4:"#fff";}";s:21:"_elementor_global_css";s:132:"a:6:{s:4:"time";i:1618421510;s:5:"fonts";a:0:{}s:5:"icons";a:0:{}s:20:"dynamic_elements_ids";a:0:{}s:6:"status";s:4:"file";i:0;b:0;}";s:40:"elementor_pro_remote_info_api_data_3.1.1";s:127319:"a:2:{s:7:"timeout";i:1618519477;s:5:"value";s:127262:"{"stable_version":"3.2.1","last_updated":"2021-03-21 15:44:17","sections":"a:2:{s:11:\"description\";s:161:\"Elementor Pro adds new features to the Elementor Page Builder plugin. Control your conversions, your user engagement, your entire website, from one page builder.\";s:9:\"changelog\";s:117763:\"<h4>3.2.1 - 2021-03-21<\/h4>\n<ul>\n<li>Tweak: Added strings context in PayPal button and Price Table widgets<\/li>\n<li>Tweak: Added support for future Import \/ Export Kit feature<\/li>\n<li>Fix: Submissions with over than 191 characters weren't indexed properly<\/li>\n<\/ul>\n<h4>3.2.0 - 2021-03-16<\/h4>\n<ul>\n<li>New: PayPal Button widget - Collect PayPal payments directly from your site<\/li>\n<li>Experiment: Submissions - Save all of your form submissions in one place (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/1686\">#1686<\/a>)<\/li>\n<li>Tweak: Added Stay In Column option to Inner Section element (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/7956\">#7956<\/a>)<\/li>\n<li>Tweak: Adjusted 'Max Height' control range in Table of Contents widget<\/li>\n<li>Tweak: Changed descriptive text in Create Custom Code screen<\/li>\n<li>Tweak: Added support for dynamic capabilities in Code Highlight widget<\/li>\n<li>Tweak: Added support for future load on demand for <code>share-link<\/code> library<\/li>\n<li>Tweak: Added support for future load on demand for <code>dialog<\/code> library in Popup<\/li>\n<li>Tweak: Allow overwriting the assets URL when using a mirror domain<\/li>\n<li>Fix: Animation was triggered multiple times when accessing the viewport in certain cases in Animated Headline widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/13951\">#13951<\/a>)<\/li>\n<li>Fix: Location is not being updated after a Custom Code snippet is published (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/13971\">#13971<\/a>)<\/li>\n<li>Fix: Custom Fonts CSS files were not updated after regenerating CSS files<\/li>\n<li>Fix: Conditions modal is not responsive in Custom Code<\/li>\n<li>Fix: Empty order buttons are displayed in Custom Fonts screen<\/li>\n<li>Fix: Typo in 'Reply To' Email action after submit placeholder in Forms widget<\/li>\n<li>Fix: Unnecessary Save Draft button in Custom Code<\/li>\n<li>Fix: RTL glitches in Custom Code<\/li>\n<li>Fix: Sanitized options in the editor to enforce better security policies<\/li>\n<li>Deprecated: See all deprecations to this version in our (<a href=\"https:\/\/developers.elementor.com\/v3-2-planned-deprecations\/\">Developers Deprecations Post<\/a>)<\/li>\n<\/ul>\n<h4>3.1.1 - 2021-02-23<\/h4>\n<ul>\n<li>Tweak: Adjusted 'Max Height' control range in Table of Contents widget<\/li>\n<li>Fix: Popup event handler is undefined (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11475\">#11475<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/10690\">#10690<\/a>)<\/li>\n<li>Fix: Conditions modal is not responsive in Custom Code<\/li>\n<li>Fix: RTL glitches in Code Highlight widget<\/li>\n<li>Fix: Minor UI glitches in Code Highlight widget<\/li>\n<li>Fix: Users can't get Pro Developer Edition version updates<\/li>\n<\/ul>\n<h4>3.1.0 - 2021-02-16<\/h4>\n<ul>\n<li>New: Introducing Custom Code - Add custom code snippets to your site, including <code>head<\/code>, <code>body<\/code> start and <code>body<\/code> end<\/li>\n<li>New: Meet Code Highlight widget - showcase any syntax with highlighted UI (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/5815\">#5815<\/a>)<\/li>\n<li>Experiment: Improved Pro widgets performance by loading JS and Swiper assets conditionally in frontend (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/8572\">#8572<\/a>, <a href=\"https:\/\/developers.elementor.com\/experiment-optimized-asset-loading\/\">Developer Documentation<\/a>)<\/li>\n<li>Tweak: Added Compatibility Tag support in Elementor Pro (<a href=\"https:\/\/developers.elementor.com\/compatibility-tag\/\">Developer Documentation<\/a>)<\/li>\n<li>Tweak: Added Dynamic capabilities to Rotating Text animation in Animated Headline widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/4625\">#4625<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/8569\">#8569<\/a>)<\/li>\n<li>Tweak: Added an option to set Selected color for Typing effect in Animated Headline widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/5403\">#5403<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/7826\">#7826<\/a>)<\/li>\n<li>Tweak: Added animation Loop option for Animated Headline (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/9749\">#9749<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/2457\">#2457<\/a>)<\/li>\n<li>Tweak: Added timing options for Animated Headline widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/4392\">#4392<\/a>)<\/li>\n<li>Tweak: Added dynamic capabilities 