timonial Carousel there is a console error thrown<\/li>\n<li>Fix: Step Buttons are cut in mobile view in Multi Step Form<\/li>\n<li>Fix: Submit and Step buttons size differences when using Twenty Twenty theme<\/li>\n<li>Fix: Duplicate button Text Color control in Slides widget<\/li>\n<li>Fix: JS error is thrown when editing and saving global widgets<\/li>\n<li>Fix: <code>get_version<\/code> API function may fail with Redis \/ DB cache<\/li>\n<li>Fix: Multiple license check requests are created in certain cases<\/li>\n<li>Deprecated: Deprecate methods prefixed with an underscore and replace them with unprefixed methods<\/li>\n<li>Deprecated: See all deprecations to this version in our <a href=\"https:\/\/developers.elementor.com\/v3-1-planned-deprecations\/\">Developers Deprecations Post<\/a><\/li>\n<\/ul>\n<h4>3.0.10 - 2021-01-20<\/h4>\n<ul>\n<li>Tweak: Added Editing Handles string translation compatibility with Elementor Pro v3.1<\/li>\n<\/ul>\n<h4>3.0.9 - 2020-12-29<\/h4>\n<ul>\n<li>Tweak: Added compatibility to support Elementor 3.1.0<\/li>\n<li>Fix: Wrong phrasing of Import template success message in Theme Builder<\/li>\n<li>Fix: Border color glitch in Theme Builder<\/li>\n<\/ul>\n<h4>3.0.8 - 2020-11-26<\/h4>\n<ul>\n<li>Fix: Navigation arrows UI glitch in Media Carousel widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/13172\">#13172<\/a>)<\/li>\n<\/ul>\n<h4>3.0.7 - 2020-11-25<\/h4>\n<ul>\n<li>Fix: Console Error when dragging Testimonials Carousel widget<\/li>\n<li>Fix: Arrows of Testimonial and Reviews Carousel widgets navigate to the wrong direction in RTL websites<\/li>\n<li>Fix: Removed the conditional loading of Webpack<\/li>\n<li>Fix: Fatal error is thrown after deleting an associated custom taxonomy when Posts widget with Cards skin has a badge<\/li>\n<li>Fix: Upload JSON files only when the user allowed to prevent security issues<\/li>\n<li>Fix: Gallery not displayed in Theme Builder templates preview<\/li>\n<\/ul>\n<h4>3.0.6 - 2020-11-04<\/h4>\n<ul>\n<li>Tweak: Updated the embedded post in Facebook Embed widget<\/li>\n<li>Fix: Minor UI glitches in Theme Builder's conditions screen footer<\/li>\n<li>Fix: Template type changes into Single Page after conditions change in Theme Builder<\/li>\n<li>Fix: Redundant Custom Caption option in Site Logo widget<\/li>\n<li>Fix: Removed unused code in Drip integration<\/li>\n<li>Fix: Removed Weibo and WeChat social networks due to website and links inactivity from Share Buttons widget<\/li>\n<li>Fix: Removed redundant code from Portfolio and Post Navigation widgets<\/li>\n<\/ul>\n<h4>3.0.5 - 2020-09-23<\/h4>\n<ul>\n<li>Fix: If the default page layout is set to &quot;Canvas&quot; Headers and Footers cannot be edited<\/li>\n<li>Fix: Product Image Dynamic Tag throws an error when no image is set<\/li>\n<li>Fix: Missing Single document placeholder in Theme Builder<\/li>\n<li>Fix: Document editing handles inherit the <code>font-family<\/code> from 3rd party source<\/li>\n<li>Fix: Can't add linebreaks to Textarea input when used as Multi Step Form<\/li>\n<li>Fix: Incorrect width in Facebook Page widget<\/li>\n<li>Fix: Added compatibility to allow the use of 'get_create_url' in Theme Builder<\/li>\n<\/ul>\n<h4>3.0.4 - 2020-09-09<\/h4>\n<ul>\n<li>Fix: Autogenerated screenshots appear in WP Media Library modal (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12304\">#12304<\/a>)<\/li>\n<li>Fix: Make sure Elementor Posts widget Pagination doesn't interfere with 3rd party plugins (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12126\">#12126<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12127\">#12127<\/a>)<\/li>\n<li>Fix: Shrinking conditions indicator in Theme Builder<\/li>\n<li>Fix: Column can't be dragged and dropped if it populates a Global widget<\/li>\n<li>Fix: Styles are missing from Single templates in some edge cases<\/li>\n<\/ul>\n<h4>3.0.3 - 2020-09-02<\/h4>\n<ul>\n<li>Fix: Pagination doesn't work in WordPress 5.5 (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12126\">#12126<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12127\">#12127<\/a>)<\/li>\n<li>Fix: Change delete template action to &quot;Move to Trash&quot; in the new Theme Builder view<\/li>\n<\/ul>\n<h4>3.0.2 - 2020-08-31<\/h4>\n<ul>\n<li>Tweak: Replaced WordPress &quot;Learn More&quot; links with dynamic links for better control over time (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12312\">#12312<\/a>)<\/li>\n<li>Tweak: UI tweaks to the Conditions screen In the new Theme Builder<\/li>\n<li>Fix: Motion Effects not working when assigned to a column and throws JS error when DOM optimization is disabled (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12299\">#12299<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12275\">#12275<\/a>)<\/li>\n<li>Fix: Multiple Galleries display all the images in the Lightbox slideshow (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11809\">#11809<\/a>)<\/li>\n<li>Fix: Old Theme Builder is being opened when accessing through the Finder<\/li>\n<li>Fix: Mixed templates import glitch in Theme Builder<\/li>\n<li>Fix: Card icon sizes in Theme Builder<\/li>\n<li>Fix: Preview button leads to <code>render_mode<\/code> instead of preview when importing a template from the new Theme Builder<\/li>\n<\/ul>\n<h4>3.0.1 - 2020-08-26<\/h4>\n<ul>\n<li>Tweak: Keep previous Theme Builder when accessing from the WP Dashboard for legacy support<\/li>\n<li>Tweak: Updated video tutorials in Theme Builder<\/li>\n<li>Tweak: Don't show auto-screenshots in the Media Library (Props <a href=\"https:\/\/github.com\/black-eye\">@black-eye<\/a>)<\/li>\n<li>Fix: Repeater items throws <code>childView<\/code> is undefined message in Forms widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12239\">#12239<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12221\">#12221<\/a>)<\/li>\n<li>Fix: Misspelling of the word &quot;occurred&quot; in Form widget default error message (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12137\">#12137<\/a>)<\/li>\n<li>Fix: Facebook comments not showing up (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/12157\">#12157<\/a>)<\/li>\n<li>Fix: Check for conflicts in Theme Builder doesn't work properly<\/li>\n<li>Fix: Minor UI fixes in Theme Builder<\/li>\n<li>Fix: Dark mode glitches in Theme Builder<\/li>\n<li>Fix: Global Site Part toaster appears when you publish a Popup<\/li>\n<li>Fix: Site Parts aren't in the correct order in Theme Builder<\/li>\n<li>Fix: Date field caused forms to get corrupted in Forms widget<\/li>\n<li>Fix: Theme Builder application page is forbidden<\/li>\n<\/ul>\n<h4>3.0.0 - 2020-08-23<\/h4>\n<ul>\n<li>New: Introducing the new and improved Theme Builder<\/li>\n<li>Tweak: Removed <code>.elementor-inner<\/code> and <code>.elementor-column-wrap<\/code> from DOM output to improve performance (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/7351\">#7351<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/7817\">#7817<\/a>, <a href=\"https:\/\/developers.elementor.com\/dom-improvements-ahead-html-wrappers-removal-from-v3-0\/\">Developers Blog Post<\/a>)<\/li>\n<li>Tweak: Added contextual anchors ID support to Table of Contents widgets (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/10052\">#10052<\/a>)<\/li>\n<li>Tweak: Added WeChat and Weibo social networks to Share Buttons widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11554\">#11554<\/a>)<\/li>\n<li>Tweak: Added Dynamic capabilities for Redirect after Login\/Logout in Login widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11343\">#11343<\/a>)<\/li>\n<li>Tweak: Added Blend Mode and CSS Filters controls to adjust the Background Overlay in Flipbox widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11653\">#11653<\/a>)<\/li>\n<li>Tweak: Added responsive capabilities to Toggle Button styling in Nav Menu widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/8269\">#8269<\/a>)<\/li>\n<li>Tweak: Added responsive Text Alignment control in Call to Action widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11968\">#11968<\/a>)<\/li>\n<li>Tweak: Added dynamic content to Ribbon element in Call to Action widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/10364\">#10364<\/a>)<\/li>\n<li>Tweak: Converted uses of Color and Typography Schemes to Global Colors and Fonts<\/li>\n<li>Tweak: Separated Title and Description control fields labels in Call to Action widget<\/li>\n<li>Tweak: Removed unnecessary style in WC Product with variations<\/li>\n<li>Tweak: Converted Portfolio, Posts and Share Buttons widgets to use CSS Variable-based Elementor Grid (<a href=\"https:\/\/developers.elementor.com\/elementor-dropping-support-ie\/\">Developers Blog Post<\/a>)<\/li>\n<li>Tweak: Added Date Modified option to Posts widget metadata<\/li>\n<li>Fix: PHP 7.4 compatibility to Media Carousel widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11355\">#11355<\/a>)<\/li>\n<li>Fix: Divider alignment issue in Post Info widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11628\">#11628<\/a>)<\/li>\n<li>Fix: Color doesn\u2019t change in Products Archive Description widget<\/li>\n<li>Fix: WC Product variations layout breaks when using Variation Swatches plugin<\/li>\n<li>Fix: WC Product variations layout issue<\/li>\n<li>Fix: WC Product variations mobile zoom-in glitch<\/li>\n<li>Fix: Can't edit a Popup after accessing Theme Style<\/li>\n<li>Fix: Twitter icon missing in Blockquote widget<\/li>\n<li>Fix: Removed redundant default text color from Share Buttons minimal skin<\/li>\n<li>Fix: UI glitch in Display Conditions modal<\/li>\n<li>Fix: Insert template button UI glitch in Templates Library<\/li>\n<li>Fix: Added sanitization to post titles in WordPress dashboard for better security<\/li>\n<li>Fix: Show when arriving from search engines rule doesn't work in Popup<\/li>\n<li>Fix: Child categories are shown with a different parent category in Query control<\/li>\n<li>Deprecated: See all deprecations to this version in our <a href=\"https:\/\/developers.elementor.com\/v3-0-planned-deprecations\/\">Developers Deprecations Post<\/a><\/li>\n<\/ul>\n<h4>2.10.3 - 2020-06-29<\/h4>\n<ul>\n<li>Fix: Form not being submitted when using &quot;Progress Bar&quot; and &quot;None&quot; view types in Multi Step Form (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11596\">#11596<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11610\">#11610<\/a>)<\/li>\n<li>Fix: Missing &quot;for&quot; attribute in Password field label in Login widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/8646\">#8646<\/a>)<\/li>\n<\/ul>\n<h4>2.10.2 - 2020-06-16<\/h4>\n<ul>\n<li>Fix: Run step events only when in Multi Step Form mode (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11644\">#11644<\/a>)<\/li>\n<\/ul>\n<h4>2.10.1 - 2020-06-16<\/h4>\n<ul>\n<li>Tweak: Improved License validation mechanism to avoid limitations<\/li>\n<li>Tweak: Changed control labels and ordering in Price Table, Lottie and Form widgets<\/li>\n<li>Fix: Popup close button vertical position glitch (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/10921\">#10921<\/a>)<\/li>\n<li>Fix: Radio field placement glitch when in Multi Step mode in Form widget<\/li>\n<li>Fix: Clicking <code>Enter<\/code> key submits the form in Multi Step Form<\/li>\n<li>Fix: Hardened sanitization in Custom Attributes to avoid security issues<\/li>\n<\/ul>\n<h4>2.10.0 - 2020-06-07<\/h4>\n<ul>\n<li>New: Introducing Multi-Step Forms - Breakdown long forms into simple steps (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/5975\">#5975<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/3911\">#3911<\/a>)<\/li>\n<li>New: Introducing Lottie widget - easily add Lottie animations to your site, no coding needed (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11026\">#11026<\/a>)<\/li>\n<li>Tweak: Added spacing option to Posts widget pagination (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/5682\">#5682<\/a>)<\/li>\n<li>Tweak: Changed texts and logic for administrator plugin renewal notices<\/li>\n<li>Tweak: Added new Scroll Util for improved scrolling handling<\/li>\n<li>Tweak: Improved Motion Effects animation performance<\/li>\n<\/ul>\n<h4>2.9.5 - 2020-05-24<\/h4>\n<ul>\n<li>Fix: Added sanitization to Custom Attributes control to avoid security issue<\/li>\n<\/ul>\n<h4>2.9.4 - 2020-05-07<\/h4>\n<ul>\n<li>Fix: Hardened user role that is allowed to upload icon sets and unzip only allowed files in Custom Icons to prevent security vulnerability<\/li>\n<\/ul>\n<h4>2.9.3 - 2020-04-19<\/h4>\n<ul>\n<li>Fix: Form shortcode IDs are not wrapped in double-quotes (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11023\">#11023<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/10932\">#10932<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/10967\">#10967<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11000\">#11000<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/11049\">#11049<\/a>)<\/li>\n<li>Fix: Escaped Form records metadata to prevent security vulnerability<\/li>\n<li>Fix: Closing &quot;Save Changes&quot; document confirmation modal causes Panel infinite loading<\/li>\n<li>Fix: Ken Burns effect not working when there is only one slide in Slides widget<\/li>\n<li>Fix: Document handles UI glitch<\/li>\n<\/ul>\n<h4>2.9.2 - 2020-03-25<\/h4>\n<ul>\n<li>Tweak: Added compatibility with WordPress v5.4 (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/10745\">#10745<\/a>)<\/li>\n<li>Fix: Image ratio number is displayed und