ew slides not showing in the editor<\/li>\n<li>Fix: Editor for section without a defined location, defaults to content area<\/li>\n<\/ul>\n<h4>2.0.3 - 2018-04-24<\/h4>\n<ul>\n<li>Tweak: Optimize CSS for Post Info widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/4214\">#4214<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/4216\">#4216<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/4225\">#4225<\/a>)<\/li>\n<li>Fix: Double render on frontend view in core locations<\/li>\n<li>Fix: Masonry not working in edge cases<\/li>\n<li>Fix: Added default setting for Author Info tag<\/li>\n<\/ul>\n<h4>2.0.2 - 2018-04-18<\/h4>\n<ul>\n<li>Fix: Regenerate conditions to include all templates<\/li>\n<\/ul>\n<h4>2.0.1 - 2018-04-17<\/h4>\n<ul>\n<li>Tweak: Added div wrapper for Nothing Found massage (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/4136\">#4136<\/a>)<\/li>\n<li>Tweak: Show empty categories in Query Control &amp; Display Conditions (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/4127\">#4127<\/a>)<\/li>\n<li>Tweak: Added Divider control for Post Info widget<\/li>\n<li>Fix: Update admin links in Yoast Breadcrumbs widget<\/li>\n<li>Fix: Sticky element conflict with clearfix CSS<\/li>\n<li>Fix: Compatibility for PHP version 5.4.32 &amp; 5.5.16 and below<\/li>\n<li>Fix: Avoid running <code>wp_head<\/code> hooks twice<\/li>\n<\/ul>\n<h4>2.0.0 - 2018-04-16<\/h4>\n<ul>\n<li>New: Introducing Theme Builder - <a href=\"https:\/\/elementor.com\/introducing-theme-builder\/\">Release Post<\/a> (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/417\">#417<\/a>)<\/li>\n<li>New: Introducing Locations API to inject custom location templates<\/li>\n<li>New: Introducing Display Conditions for all dynamic templates<\/li>\n<li>New: Introducing Dynamic Tag feature - a new way to add dynamic content to your design<\/li>\n<li>New: Introducing Role manager to allow &quot;Content Only mode&quot; (<