ub.com\/elementor\/elementor\/issues\/2054\">#2054<\/a>)<\/li>\n<li>New: Partial support for Toolset integration (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/2949\">#2949<\/a>)<\/li>\n<li>New: Partial support for Pods integration (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/2169\">#2169<\/a>)<\/li>\n<li>New: Partial support for ACF integration (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/2041\">#2041<\/a>, <a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/2059\">#2059<\/a>)<\/li>\n<li>Tweak: Add custom fields support for ActiveCampaign (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/3531\">#3531<\/a>)<\/li>\n<li>Tweak: Allow brackets in Forms Tel field<\/li>\n<li>Tweak: Added currency format control for Price Table widget<\/li>\n<li>Tweak: Reduced API request for some servers<\/li>\n<li>Fix: Dropdown <code>border-radius<\/code> in Nav Menu widget<\/li>\n<li>Fix: Price List widget layout breaks in edge cases<\/li>\n<li>Note: This version requires Elementor v2.0.6<\/li>\n<\/ul>\n<h4>1.15.6 - 2018-03-28<\/h4>\n<ul>\n<li>Fix: Removed duplicate Custom CSS section (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/3938\">#3938<\/a>)<\/li>\n<li>Fix: <code>box-shadow<\/code> issue with cards skin (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/3940\">#3940<\/a>)<\/li>\n<\/ul>\n<h4>1.15.5 - 2018-03-27<\/h4>\n<ul>\n<li>Fix: Added global widget compatibility for Elementor v2.0<\/li>\n<li>Fix: Reduced API request for some servers<\/li>\n<\/ul>\n<h4>1.15.4 - 2018-03-26<\/h4>\n<ul>\n<li>Tweak: Allow brackets in phone field<\/li>\n<li>Tweak: Added compatibility with Yoast 7.0.+<\/li>\n<li>Tweak: Added compatibility for the future release of Elementor v2.0<\/li>\n<li>Fix: Support for multiple carousel setting in editor<\/li>\n<li>Fix: <code>on_export<\/code> issue in forms widget (<a href=\"https:\/\/github.com\/elementor\/elementor\/issues\/3890\">#3890<\/a>)<\/li>\n<\/ul>\n